import React from 'react';
// import './Login.css'; // Arquivo de estilo CSS

import LoginForm from './Components/LoginForm/LoginForm'; // Importa o componente de formulário de login

function Login() {
  return (
    <div className="main-login">
      <div className="left-login">
        <h1>Faça login<br/>E entre para o nosso time</h1>
        <img src="./assets/img/investment.svg" className="left-login-image" alt="Investiment animation" />
      </div>
      <div className="right-login">
        <div className="card-login">
          <h1>LOGIN</h1>
          <LoginForm /> {/* Renderiza o componente de formulário de login */}
        </div>
      </div>
    </div>
  );
}

export default Login;
